package ccxt

type Bithumb struct {
	*bithumb
	Core          *bithumb
	exchangeTyped *ExchangeTyped
}

func NewBithumb(userConfig map[string]interface{}) *Bithumb {
	p := &bithumb{}
	p.Init(userConfig)
	return &Bithumb{
		bithumb:       p,
		Core:          p,
		exchangeTyped: NewExchangeTyped(&p.Exchange),
	}
}

